import React from 'react'
import NavBar from './components/NavBar/NavBar'
import Schedule from '../Schedule/Schedule'
import AdminApp from '../Admin/Admin'

function App() {
  return (
    <Switch>
        <Route path="/login">
            <AdminApp />
        </Route>
        <Route path="/schedule">
            <NavBar />
            <Schedule />
        </Route>
    </Switch>
  );
}

export default App;
